insert  into `blogs`(`id`,`user_id`,`title`,`subtitle`,`image`,`content`,`category`,`created_at`,`updated_at`) values 
(4,27,'How to give yourself the time you need to grieve after a loss','When a loved one passes away, itâ€™s no surprise that our grief runs deep. Grieving is a personal experience and explaining your emotional pain to someone who has not experienced a similar loss may prove to be frustrating.','1635431428lung.png','<p><br></p><p><em><br></em></p><p><img style=\"visibility: visible; width: 100%;\" src=\"data:image/png;base64,\" data-xblocker=\"passed\" data-filename=\"lung.png\"><em><br></em></p><p class=\"MsoNormal\">When a loved one passes away, itâ€™s no surprise that our\r\ngrief runs deep. Grieving is a personal experience and explaining your\r\nemotional pain to someone who has not experienced a similar loss may prove to\r\nbe frustrating. <o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">Donâ€™t let the reactions of others affect you. Often people\r\njust donâ€™t know how to react to death and they may say things that seem\r\ninsensitive. Keep in mind that they donâ€™t mean to. Only you know how much your loved\r\none touched your heart, so that means you are the only person who gets to\r\ndecide how and for how long you grieve.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">For some, their grief catches them off guard and they try to\r\nbury it deep down inside, pretending that they are OK and that nothing in life\r\nhas changed. In reality, grieving for a spouse, child, parent, grandparent,\r\nspecial friend or co-worker is actually a deeply intense personal experience.\r\nAs such, the process should be respected and embraced. Give yourself the time\r\nyou need to grieve. Here are some ideas to help you work through the grief:<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><b>Donâ€™t rush back to\r\nnormal activities<o:p></o:p></b></p><p class=\"MsoNormal\">Of course, after a period of bereavement, youâ€™ll need to go back\r\nto work and take care of your daily responsibilities. Ease back into your busy\r\nlifestyle slowly and donâ€™t overschedule yourself in an attempt to distract\r\nyourself from your grief. Slow things down for a bit and take the time you need\r\nto be sorrowful. <o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">Donâ€™t feel like you have to rush to pack away all of your loved\r\noneâ€™s items, if you are responsible for that task. If possible, leave their\r\npersonal belongings alone for a while. When youâ€™re emotionally ready, invite a\r\nfamily member or close friend to help you sort through clothing, jewelry,\r\nhousehold goods and family heirlooms. If you would like, donate practical items\r\nto a local charity. You can also donate the other items or give them to family\r\nmembers, but you might want to give yourself some time to decide first. <o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><b>Remember the good\r\ntimes<o:p></o:p></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">It is heart-wrenching to return home those first few times\r\nand not see your loved sitting on the couch waiting for you or to have\r\nsomething good happen in your life and your instinct is to pick up the phone to\r\ncall your loved one and share the news. Try not to dwell on how your loved one\r\npassed away and instead remember how you felt during special conversations or\r\nalways had to have a piece of chocolate at 10 p.m. sharp. Try to smile when you\r\nthink about the way your loved one loved camping, bonfires and other special\r\nevents.<o:p></o:p></p>',1,'2021-10-27 10:54:14','2021-10-28 14:30:28'),
(6,27,'sdfsdfsdf','sdfsdf','1635395193lung.png','<p>sdfsdfsdf</p>',1,'2021-10-28 04:24:52','2021-10-28 04:26:33');

